import react from "react";

function AboutUs()
{
    return(
        <div className="box">
            <div className="container">
                <h3>Mysore Motors</h3>
                <div className="social">
                    <a href="#">instagram</a>
                    <a href="#">Linkedin</a>
                    <a href="#">FaceBook</a>
                </div>
            </div>
        </div>
    );
}
export default AboutUs;
